import React from "react";

import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

import "./App.css";
import Login from "./components/layouts/Login";
import Registrasiton from "./components/layouts/Registrasiton";

import GoogleLogin from "react-google-login";
import FacebookLogin from "react-facebook-login";

function App() {
  const componentClicked = () => console.log("clicked");
  const responseFacebook = (res) => console.log(res);
  const responseGoogle = (response) => {
    console.log(response);
  };
  return (
    <Router>
      <div className="container">
        <FacebookLogin
          appId="188474982588826"
          autoLoad={true}
          fields="name,email,picture"
          onClick={componentClicked}
          callback={responseFacebook}
        />
        <GoogleLogin
          clientId="31144990250-af7v037tre8euf10tg1o4am9b8oaj5ll.apps.googleusercontent.com"
          buttonText="Login"
          onSuccess={responseGoogle}
          onFailure={responseGoogle}
          cookiePolicy={"single_host_origin"}
        />
        <Switch>
          <Route exact path="/" component={Login} />
          <Route exact path="/registrasiton" component={Registrasiton} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
